import streamlit as st
import pickle
import sklearn
st.image('data:image/png;base64,')
st.title('Sentiment Analysis')
text=st.text_input('enter the text')
model=pickle.load(open(r"C:\Users\Admin\Downloads\sentiment.pkl",'rb'))
st.button('submit')
result=model.predict([text])
st.write(result)
if result == 'Positive':
    st.image('https://w7.pngwing.com/pngs/430/586/png-transparent-thumbs-up-smiley-face-emoji-happy-smiley-face-thumb-positive.png')
elif result == 'Neutral':
     st.image('data:image/jpeg;base64,')
elif result == 'Negative':
     st.image('https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ-gPatqxoCrxM3ZU03vubRXHrWBUCqKmjeZA&usqp=CAU')